import pandas as pd
import numpy as np
from scipy import stats
import json

# Read the data with correct file paths
world_cities = pd.read_csv('/home/gridsan/elai/Kramabench/data/archeology/input/worldcities.csv')
roman_cities = pd.read_csv('/home/gridsan/elai/Kramabench/data/archeology/input/roman_cities.csv')

# Subtask 1: Process Roman cities ranks
def process_rank(rank):
    if pd.isna(rank):
        return np.nan
    if isinstance(rank, str) and 'or' in rank:
        nums = [float(x.strip()) for x in rank.split('or')]
        return sum(nums) / len(nums)
    try:
        return float(rank)
    except:
        return np.nan

roman_cities['rank'] = roman_cities['Barrington Atlas Rank'].apply(process_rank)
subtask1_result = roman_cities['rank'].notna().sum()

# Subtask 2: Filter modern cities
world_cities_filtered = world_cities[world_cities['population'] >= 1000000].copy()
subtask2_result = len(world_cities_filtered)

# Subtask 3: Match cities based on distance
def calculate_distance(lat1, lon1, lat2, lon2):
    return np.sqrt((lat1 - lat2)**2 + (lon1 - lon2)**2)

matches = []
for _, modern in world_cities_filtered.iterrows():
    for _, ancient in roman_cities.iterrows():
        dist = calculate_distance(
            modern['lat'], modern['lng'],
            ancient['Latitude (Y)'], ancient['Longitude (X)']
        )
        if dist < 0.1:
            matches.append({
                'modern_city': modern['city'],
                'ancient_city': ancient['Ancient Toponym'],
                'population': modern['population'],
                'rank': ancient['rank'],
                'end_date': ancient['End Date']
            })

matches_df = pd.DataFrame(matches)
subtask3_result = len(matches_df)

