if not matches_df.empty:
    # Sort by End Date to get the latest sample
    matches_df = matches_df.sort_values('end_date')
    # Drop duplicates keeping the last occurrence
    final_matches = matches_df.drop_duplicates('modern_city', keep='last')
    # Calculate correlation
    correlation = stats.pearsonr(
        final_matches['population'],
        final_matches['rank']
    )[0]
    # Round to 6 decimal places
    final_result = round(correlation, 6)
else:
    final_result = None

# Print results
print(json.dumps({
    "subtask-1": f"Processed {subtask1_result} valid ranks",
    "subtask-2": f"Found {subtask2_result} cities with population >= 1M",
    "subtask-3": f"Found {subtask3_result} matches within 0.1 degrees",
    "main-task": final_result
}, indent=4))
